import React, { useState } from "react";
import "materialize-css/dist/css/materialize.min.css";

const backgroundColor = {
  backgroundColor: "#000", // Fundo preto
};

const botaoStyle = {
  padding: "10px",
  fontFamily: "arial",
  backgroundColor: "#000", // Fundo do botão preto
  color: "#fff", // Texto do botão branco
  border: "none", // Remove bordas
  cursor: "pointer", // Alterar cursor para indicar que é clicável
};

const fontStyle = {
  fontSize: "xx-large",
  fontFamily: "arial",
  color: "#fff", // Texto branco
};

const ListaConsumos = () => {
  const [consumos] = useState([
    { cliente: "João Silva", servico: "Limpeza de Pele", produto: "Shampoo Hidratante", preco: "R$ 30,00" },
    { cliente: "Maria Souza", servico: "Hidratação Facial", produto: "Creme de Hidratação Intensiva", preco: "R$ 45,00" },
    // Dados de exemplo
  ]);

  return (
    <div>
      <nav className="">
        <div style={backgroundColor} className="nav-wrapper">
          <a className="brand-logo right" style={fontStyle}>
            World Beauty
          </a>
          <a style={botaoStyle} href="/cadServico">Cadastros</a>
          <a style={botaoStyle} href="/listaCliente">Cliente</a>
          <a style={botaoStyle} href="/listaProduto">Produto</a>
          <a style={botaoStyle} href="/listaPedidos">Consumo</a>
          <a style={botaoStyle} href="/listaServicos">Serviços</a>
          <a style={botaoStyle} href="/Listagens">Listagens</a>
        </div>
      </nav>
      <h4>Lista de Pedidos</h4>
      <table>
        <thead>
          <tr>
            <th>Cliente</th>
            <th>Serviço</th>
            <th>Produto</th>
            <th>Preço</th>
          </tr>
        </thead>
        <tbody>
          {consumos.map((consumo, index) => (
            <tr key={index}>
              <td>{consumo.cliente}</td>
              <td>{consumo.servico}</td>
              <td>{consumo.produto}</td>
              <td>{consumo.preco}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ListaConsumos;
